import React from "react";
const axios = require('axios');

const fetchBanks = async () => {
    try {
        const banks = await axios.get('http://localhost:3001/fetchBanks')
        return banks.data
    } catch(e) {
        console.log("Couldn't fetch banks!" + e)
    }
}

export default fetchBanks
